import React from 'react';
import { ClassNames } from 'helpers/ClassNames/ClassNames';
import cls from './TestingTable.module.css';

export const TestingTable = (props) => {
    const { 
        className,
        task,
        index
    } = props;

    return (
        <div className={ClassNames(cls.testingTable, {}, [className])}>
            <h2>{index} Вопрос</h2>
            <h2>{task.question}</h2>
        </div>
 );
}
